import React, { useCallback, useState } from 'react';
import { useDropzone } from 'react-dropzone';

const Main = () => {
  const [files, setFiles] = useState([]);
  const [pdfText, setPdfText] = useState('');
  const [uploading, setUploading] = useState(false);

  const onDrop = useCallback(acceptedFiles => {
    acceptedFiles.forEach(file => handleFileUpload(file));
  }, []);

  const handleFileUpload = async (file) => {
    setUploading(true);
    const formData = new FormData();
    formData.append('pdf', file);

    try {
      const response = await fetch('/upload', {
        method: 'POST',
        body: formData,
      });
      const data = await response.json();
      setFiles(prevFiles => [...prevFiles, file.name]);
      setPdfText(data.text);
    } catch (error) {
      console.error('Error:', error);
      setPdfText('');
    } finally {
      setUploading(false);
    }
  };

  const { getRootProps, getInputProps } = useDropzone({
    onDrop,
    accept: 'application/pdf',
    noClick: true, // Prevents opening file dialog on click
    noKeyboard: true // Prevents opening file dialog on SPACE or ENTER
  });

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h1 style={styles.title}>AcquiSolar</h1>
        <a href="/about" style={styles.aboutLink}>About Us</a>
      </header>
      <div style={styles.main}>
        <div style={styles.leftPanel}>
          <div {...getRootProps({ style: styles.dropzone })}>
            <input {...getInputProps()} />
            <p style={styles.dropzoneText}>Just drag and drop your files. We'll do the rest.</p>
          </div>
          <button style={styles.analyzeButton} disabled={uploading}>Analyze</button>
        </div>
        <div style={styles.fileListContainer}>
          <h3>Uploaded Files</h3>
          <ul style={styles.fileList}>
            {files.map((fileName, index) => (
              <li key={index} style={styles.fileName}>{fileName}</li>
            ))}
          </ul>
        </div>
        <div style={styles.textDisplayContainer}>
          <h3>Extracted Text</h3>
          <div style={styles.extractedText}>
            {pdfText || (uploading ? 'Uploading and processing...' : 'No text extracted yet.')}
          </div>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: 'Arial, sans-serif',
    height: '100vh',
    backgroundColor: '#9ACAC4',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'flex-start',
  },
  header: {
    width: '100%',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '20px',
    color: 'white',
  },
  searchBarContainer: {
    width: '100%',
    display: 'flex',
    justifyContent: 'center',
    padding: '0 20px',
  },
  searchBar: {
    width: '100%',
    maxWidth: '300px',
    padding: '10px',
    margin: '10px 0',
    borderRadius: '20px',
    border: '1px solid #ccc',
    outline: 'none',
  },
  content: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    padding: '20px',
  },  title: {
    margin: 0,
  },
  aboutLink: {
    color: 'white',
    textDecoration: 'none',
    backgroundColor: '#9ACAC4', // Match the header background color
    padding: '5px 10px', // Add some padding
    borderRadius: '5px', // Optional: add some rounding to match your design
  },
  dropzone: {
    padding: '20px',
    width: '300px',
    height: '400px',
    borderWidth: '2px',
    borderRadius: '20px',
    borderColor: '#cccccc',
    borderStyle: 'dashed',
    backgroundColor: '#ffffff',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
  },
  uploadText: {
    color: '#000000',
    marginBottom: '20px',
    fontSize: '18px',
    fontWeight: 'bold',
  },
  fileListContainer: {
    width: '100%',
    flex: 1,
    backgroundColor: '#E6F0EF',
    borderRadius: '10px',
    padding: '10px',
    textAlign: 'left',
    maxHeight: '150px',
    overflowY: 'auto', // Allow scrolling for multiple files
  },
  fileList: {
    listStyleType: 'none',
    padding: 0,
    margin: 0,
  },
  fileName: {
    color: '#000000',
    fontSize: '16px',
    lineHeight: '24px',
    padding: '5px 0',
  },
  analyzeButton: {
    padding: '10px 20px',
    fontSize: '16px',
    backgroundColor: '#4CAF50',
    border: 'none',
    borderRadius: '20px',
    cursor: 'pointer',
    color: 'white',
    alignSelf: 'flex-start', // Align the button to the left
  },
  textDisplayContainer: {
    minWidth: '300px',
    height: '400px',
    backgroundColor: '#E6F0EF',
    borderRadius: '20px',
    padding: '20px',
    marginLeft: '20px',
    overflowY: 'auto',
  },
  extractedText: {
    whiteSpace: 'pre-wrap', // Preserves spaces and line breaks
  },
  main: {
    display: 'flex',
    justifyContent: 'flex-start',
    alignItems: 'flex-start',
    width: '100%',
  },
  leftPanel: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'flex-start',
  },
};

export default Main;
